INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(44, 'olahraga', '\n                  <p></p><p>Alat ini dapat membantu Anda untuk membentuk otot-otot lengan ataupun perut dengan mudah. Bagi Anda yang memiliki waktu terbatas dan tidak bisa pergi ke tempat fitness, Anda tetap dapat berolahraga di rumah hanya dengan menggunakan alat ini. Anda dapat melakukan berbagai macam gerakan yang bisa membantu pembentukan otot-otot tubuh.</p><p></p>\n                ', 'data:image/jpeg;base64,', 'AB Wheel Sport Alat Gym Fitness Roller - YY-1601 - No Color', 31600, 31, NULL);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(46, 'olahraga', '\n                  <p>                  </p><p>Bekerja atau melakukan aktivitas di tempat gelap memerlukan sumber penerangan tambahan. Agar pergerakan tangan Anda tidak terganggu dengan memegang senter, Anda bisa menggunakan senter kepala atau headlamp dari Alloet. Senter dengan lampu LED COB ini mampu menerangi objek sekitar dengan penerangan optimal. Dilengkapi dengan tali strap fleksibel dan dapat disesuaikan. Terlindungi dengan fitur waterproof IPX4 sehingga cocok untuk kegiatan outdoor.</p>\n                <p></p>\n                ', 'data:image/jpeg;base64,', 'Alloet Senter Kepala Headlamp LED COB Waterproof IPX4 150lm 10W - BL35 - Black', 8100, 21, NULL);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(47, 'olahraga', '                  <p>Memiliki masalah dengan lutut Anda? AOLIKES menyediakan solusi yang tepat dengan produk knee support atau penopang lutut yang dirancang khusus untuk memberikan dukungan dan kenyamanan yang diperlukan untuk lutut Anda. Penopang lutut dibuat dari bahan yang berkualitas tinggi untuk memberikan dukungan yang optimal dan mencegah cedera. Jangan biarkan masalah lutut Anda menghambat aktivitas Anda sehari-hari. Dapatkan knee support dari AOLIKES sekarang dan rasakan perbedaan yang signifikan dalam kenyamanan dan mobilitas lutut Anda.</p>\r\n                ', 'data:image/jpeg;base64,', 'AOLIKES Pelindung Lutut Knee Support Compression Sport Fitness XL - A-7718 - Black', 23300, 19, NULL);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(48, 'olahraga', '                  <p>Buat kegiatan berkemah Anda semakin seru tanpa kesulitan mendirikan tenda. Tenda dari WolFAce ini merupakan teman camping yang sesungguhnya. Dengan fitur buka-tutup cepat, Anda dapat membangun tenda camping hanya dalam hitungan detik. Sifat anti air dan tahan panasnya membuat Anda dan keluarga dapat menikmati kegiatan berkemah tanpa khawatir guyuran hujan atau teriknya matahari.</p>\r\n                ', 'data:image/jpeg;base64,', 'WolFAce Tenda Camping Lipat Otomatis Quick Open Rain Proof 3-4 Person - SMF828 - Green', 373600, 0, 2);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(49, 'elektronik', '\n                  <p>\n                  </p><p>                  </p><p>Humidifer atau pelembap udara ini berfungsi untuk menjaga kelembapan udara dan juga dapat digunakan sebagai aromatherapy dengan menaruh sedikit pewangi di dalam airnya. Desainnya yang cantik membuat pelembap udara ini dapat menambah nilai plus untuk dekorasi ruang tamu maupun kamar tidur Anda. Dilengkapi baterai sehingga humidifier ini bisa digunakan secara portable.</p>\n                <p></p>\n                <p></p>\n                ', 'data:image/jpeg;base64,', '3LIFE Air Humidifier Pelembap Udara Portable Aromatherapy 1000ml - 211 - White', 132900, 15, 2);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(50, 'elektronik', '                  <p>Apakah Anda kurang puas dengan speaker bawaan pabrik? Apakah selama ini sistem audio yang Anda gunakan memiliki suara yang kurang memuaskan? Speaker ini bisa menjadi jawaban karena Anda akan mendapatkan dua buah speaker satelit dan subwoofer. Dengan bantuan subwoofer, suara yang dihasilkan speaker akan lebih bulat dan penuh.</p>\r\n                ', 'data:image/jpeg;base64,', 'Active Speaker Stereo 2.1 with Subwoofer & USB Power - D-203 - Black', 106400, 20, 2);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(51, 'elektronik', '                  <p>Jika musik menjadi unsur penting untuk menjalani hari-hari Anda maka soundbar adalah bagian yang tak boleh terlewatkan! Soundbar BT601 dari AFK mampu membuat Anda menikmati musik dengan efek bass HiFi yang stabil dilengkapi dengan lampu LED RGB yang warna-warni. Tunggu apalagi? Buat suasana karaoke di rumah Anda menjadi lebih seru dengan AFK Soundbar Speaker BT601 sekarang juga!</p>\r\n                ', 'data:image/jpeg;base64,', 'AFK Soundbar Active Speaker Bluetooth Home Theater HiFi LED RGB - BT601 - Black', 178300, 18, 2);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(52, 'elektronik', '                  <p>Jika musik adalah bagian dari kehidupan Anda, gunakan digital audio player dari ALianDream karena dapat memutar musik dengan kualitas tinggi serta dapat menampilkan video dalam format AMV. Mendukung beragam format file audio sehingga Anda bisa memutar musik tanpa batas. Dapat dikoneksikan dengan headphone maupun earphone lewat jaringan bluetooth. Memiliki bentuk yang kecil sehingga sangat cocok untuk dibawa saat aktivitas olahraga atau outdoor. Memiliki fitur tambahan seperti ebook, kamus, hingga alarm.</p>\r\n                ', 'data:image/jpeg;base64,', 'ALianDream MP3 Digital Audio Player Bluetooth 5.0 300 mAh 2.5 Inch - M7 - Black', 209700, 12, NULL);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(53, 'photography', '                  <p>Saat sedang bepergian, Anda pasti ingin mengabadikan momen dalam bentuk video maupun foto. Agar momen Anda dapat terekam dengan lebih nyaman, Anda bisa menggunakan tripod HP dari ACEHE. Ukurannya yang ringkas, ringan, dan juga kokoh ini cocok digunakan untuk berbagai macam jenis smatphone. Holder pada tripod juga dapat disesuaikan ukurannya sehingga cocok untuk banyak jenis smartphone.</p>\r\n                ', 'data:image/jpeg;base64,', 'ACEHE Tripod HP Monopod Portable Rotateable 1/4 Screw - K-518 - Black', 9400, 100, 2);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(54, 'photography', '                  <p>Jika Anda seorang videografer atau bekerja di bidang perfilman maka Anda membutuhkan stand C dari BREZ ini. Alat ini memiliki peran penting yang dapat mempengaruhi kualitas video maupun film. Termasuk ke dalam alat serbaguna yang dirancang untuk menempatkan lampu, cutter light, kain silk, background dan alat lainnya pada satu set.</p>\r\n                ', 'data:image/jpeg;base64,', 'BREZ Stand C Lighting Photography with Boom Arm and Grip Head 260cm - BR-260 - Silver', 893800, 10, 2);
INSERT INTO `tb_product` (`id_product`, `category`, `description`, `image`, `name`, `price`, `stock`, `id_user`) VALUES
(55, 'photography', '                  <p>Payung studio ini berfungsi untuk merefleksikan cahaya dari lampu flash sehingga lebih merata dan tidak ada hotspot cahaya. Bagi Anda yang ingin membuat foto studio wajib untuk memiliki payung studio ini untuk menghasilkan foto yang berkualitas. Selain itu payung ini juga dilengkapi dengan kain penutup sehingga dapat dijadikan softbox.</p>\r\n                ', 'data:image/jpeg;base64,', 'CY Payung Octagonal Softbox Reflektor Flash 95 CM - 8K-95 - Black', 142900, 0, NULL);

